$jit.TM.Plot.NodeTypes.implement({
  'filter-rect': {
    'render': function(node, canvas) {
      if(node.data.$width > 5 && node.data.$height > 5) {
        this.nodeTypes.rectangle.render.call(this, node, canvas);
      }
    },
    'contains': function(pos, node) {
      return this.nodeTypes.rectangle.contains.call(this, pos, node);
    }
  }
});

var entering = false, 
    levelsToShow = 2, 
    nbNodes = 19, 
    jsonString = JSON.stringify(json),
    isFile = /.*[a-zA-Z][a-zA-Z0-9\_]+\.[a-zA-Z0-9]+.*/;

function init(){
  //init TreeMap
  var tm = new $jit.TM.Squarified({
    //where to inject the visualization
    injectInto: 'infovis',
    //parent box title heights
    titleHeight: 15,
    //enable animations
    animate: animate,
    cushion: true,
    //box offsets
    offset: 0.2,
    levelsToShow: levelsToShow,
    Node: {
      type: 'filter-rect'
    },
    Label: {
      type: 'HTML'
    },
    hideLabels: false,
    //Attach left and right click events
    Events: {
      enable: true,
      onClick: function(node) {
        if(node) {
          entering = true;
          tm.enter(node);
        }
      },
      onRightClick: function() {
        entering = false;
        tm.out();
      }
    },
    onBeforePlotNode: function(node) {
      if (tm.leaf(node)) {
       if(node.name.match(isFile)) {
        node.setData('color', '#4DAF4A');
      } else {
        node.setData('color', '#377EB8');
      }
      } else {
        node.removeData('color');
      }
    },
    duration: 1000,
    //Implement this method for retrieving a requested  
    //subtree that has as root a node with id = nodeId,  
    //and level as depth. This method could also make a server-side  
    //call for the requested subtree. When completed, the onComplete   
    //callback method should be called.  
    request: function(nodeId, level, onComplete){  
      var newjson = JSON.parse(jsonString); 
      var subtree = $jit.json.getSubtree(newjson, nodeId);  
      $jit.json.prune(subtree, level);
      $jit.json.each(subtree, function(n) {
       if(n.children && n.children.length > nbNodes) {
          var chArray = n.children;
          chArray.sort(function(a, b) {
            return b.data.$area - a.data.$area;
          });
          n.children.length = nbNodes;
        }
      });
      onComplete.onComplete(nodeId, subtree);  
    },
   //Add the name of the node in the correponding label
    //This method is called once, on label creation.
    onCreateLabel: function(domElement, node){
        domElement.innerHTML = node.name;
        var style = domElement.style;
        style.display = '';
    },
    
    onAfterCompute: function() {
      if(!entering && tm.clickedNode) {
        var d = tm.clickedNode._depth;
        var graph = tm.graph;
        graph.eachNode(function(n) {
          if(n._depth > d + levelsToShow) {
            graph.removeNode(n.id);
          }
        });
      }
    }
  });

  var newjson = JSON.parse(jsonString); 
  $jit.json.prune(newjson, levelsToShow);  
  $jit.json.each(newjson, function(n) {
    if(n.children) {
      var chArray = n.children;
      chArray.sort(function(a, b) {
        return b.data.$area - a.data.$area;
      });
      n.children = chArray.slice(0, nbNodes);
    }
  });
  
  tm.loadJSON(newjson);
  tm.refresh();
  //end
}

